                <Typography sx={{ color: "text.secondary", mb: "1rem" }}>
                    Sorry, we couldnâ€™t find the page you requested.
                </Typography>
                <Button to="/" variant="contained" component={RouterLink}>
                    Go to Home
                </Button>
            </Box>
        </Container>
    );
}
